// Dashboard.jsx
import React, { useState, useEffect } from 'react';
import { Grid, Typography, backdropClasses } from '@material-ui/core';
import styled from 'styled-components'; // Import styled from styled-components
import { gridSpacing } from '../../store/constant';
import Admission from '../admission/Admission.jsx';
import TotalChartCard from '../../ui-component/cards/TotalChartCard/index.js';
import { useMediaQuery } from 'react-responsive';
import Contact from '../contact/Contact.jsx';
import SubCard from '../../ui-component/cards/SubCard/index.js';
import TableBasic from '../forms/tables/TableBasic/index.js';
// Define your styled component
const StyledGrid = {

height: "100%",
width:"100%",
zIndex:"1000",
// backgroundColor:"white",
position:"fixed",

// top:"80px",
// left:"280px",

}
const SmallScreen = {

  height: "100%",
  width:"100%",
  zIndex:"1000",
  // backgroundColor:"white",
  position:"fixed",
  }
  const Mediumscreen = {

    height: "100%",
    width:"100%",
    zIndex:"1000",
    // backgroundColor:"white",
    position:"fixed",


    }

const Dashboard = () => {
  const [greeting, setGreeting] = useState('');
const[smallScreen,setSmallScreen]=useState(StyledGrid)

useEffect(()=>{
  if(window.innerWidth>957){
    setSmallScreen(StyledGrid)}
    else if(window.innerWidth<957&&window.innerWidth>640)
      {
        setSmallScreen(Mediumscreen)
      }
      else{
        setSmallScreen(SmallScreen)
      }
},[window.innerWidth])

  useEffect(() => {
    const currentHour = new Date().getHours();
    setGreeting(getGreeting(currentHour));
  }, []);

  const getGreeting = (hour) => {
    if (hour >= 5 && hour < 12) {
      return 'Good Morning Admin';
    } else if (hour >= 12 && hour < 18) {
      return 'Good Afternoon Admin';
    } else {
      return 'Good Evening Admin';
    }
  };

  return (
    <Grid container style={smallScreen}>

      <Grid item xs={12}>
        <Typography variant="h1" gutterBottom>
          {greeting}
        </Typography>

      </Grid>
      <Card>
          <CardHeader title="Admission Data" />
          <Divider />
          <CardContent>
            {formDataList.length > 0 ? (
              <TableContainer>
                <Table aria-label="admission data table">
                  <TableHead>
                    <TableRow>
                      <TableCell>Parent Name</TableCell>
                      <TableCell>Child Name</TableCell>
                      <TableCell>DOB</TableCell>
                      <TableCell>Gender</TableCell>
                      <TableCell>Current School</TableCell>
                      <TableCell>Grade Applying For</TableCell>
                      <TableCell>Preferred Start Date</TableCell>
                      <TableCell>Questions/Comments</TableCell>
                      <TableCell>How Did You Hear About Us</TableCell>
                      <TableCell>Address</TableCell>
                      <TableCell>Delete</TableCell> {/* New cell for Delete action */}
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {formDataList.map((formData) => (
                      <TableRow key={formData._id}>
                        <TableCell>{`${formData.parentFirstName} ${formData.parentLastName}`}</TableCell>
                        <TableCell>{`${formData.childFirstName} ${formData.childLastName}`}</TableCell>
                        <TableCell>{`${formData.dateOfBirth.split('T')[0]}`}</TableCell>
                        <TableCell>{`${formData.gender}`}</TableCell>
                        <TableCell>{`${formData.currentSchool}`}</TableCell>
                        <TableCell>{`${formData.gradeApplyingFor}`}</TableCell>
                        <TableCell>{`${formData.preferredStartDate.split('T')[0]}`}</TableCell>
                        <TableCell>{`${formData.questionsComments}`}</TableCell>
                        <TableCell>{`${formData.howDidYouHearAboutUs}`}</TableCell>
                        <TableCell>{`${formData.address}`}</TableCell>
                        <TableCell>
                          <Button
                            variant="contained"
                            color="secondary"
                            onClick={() => handleDelete(formData._id)}
                          >
                            Delete
                          </Button>
                        </TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            ) : (
              <Typography variant="body1">No data available</Typography>
            )}
          </CardContent>
        </Card>
    </Grid>
  );
};

export default Dashboard;
